UPDATE Opportunity
   SET oppo_Status = 'NotSold', oppo_Stage = 'Lead'
 WHERE oppo_Status = 'Closed' AND oppo_Stage = 'Initial';
   
UPDATE Opportunity
   SET oppo_Status = 'Open', oppo_Stage = 'Lead'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Initial';   
   
UPDATE Opportunity
   SET oppo_Status = 'Open', oppo_Stage = 'Lead'
 WHERE oppo_Status = 'Open' AND oppo_Stage IS NULL;      
   
UPDATE Opportunity
   SET oppo_Status = 'Open', oppo_Stage = 'Prospect'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Negotiating';   

UPDATE Opportunity
   SET oppo_Status = 'Open', oppo_Stage = 'Prospect'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Qualified';    
   
UPDATE Opportunity
   SET oppo_Status = 'NotSold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Closed' AND oppo_Stage = 'Deal Lost';
   
UPDATE Opportunity
   SET oppo_Status = 'NotSold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Deal Lost';   
   
UPDATE Opportunity
   SET oppo_Status = 'NotSold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Closed' AND oppo_Stage = 'DealLost';   
   
UPDATE Opportunity
   SET oppo_Status = 'Sold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Closed' AND oppo_Stage = 'Closed';     
   
UPDATE Opportunity
   SET oppo_Status = 'Sold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Closed';    
   
UPDATE Opportunity
   SET oppo_Status = 'Sold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Closed' AND oppo_Stage = 'Sale Closed';       
   
UPDATE Opportunity
   SET oppo_Status = 'Sold', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Open' AND oppo_Stage = 'Sale Closed';          
   
UPDATE Opportunity
   SET oppo_Status = 'Open', oppo_Stage = 'Opportunity'
 WHERE oppo_Status = 'Open'AND oppo_Stage = 'Quoted';   
Go   


--
--  Some companies are missing Attention Lines, probably because of 
--  listing status changes.
--
DECLARE @ItemCode varchar(40)

SET @ItemCode = 'LRL'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2');

SET @ItemCode = 'JEP'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2');

SET @ItemCode = 'TES-E'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2');

SET @ItemCode = 'TES-V'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2');

SET @ItemCode = 'BILL'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2');

--
--  Lumber companies do not get a mail TES
-- 
SET @ItemCode = 'TES-M'
SELECT comp_CompanyID, @ItemCode, -1, -1
  FROM Company
 WHERE comp_CompanyID NOT IN (SELECT DISTINCT prattn_CompanyID FROM PRAttentionLine WHERE prattn_ItemCode = @ItemCode)
   AND comp_PRListingStatus IN ('L', 'LUV', 'N2')
   AND comp_PRIndustryType <> 'L';
